import "../App.css";
import React from 'react';
import Header from '../components/Header';
import Button from '../components/button';

const home = () => {
  return (
    <div className="App">
      <Header title="Doodly"/>
      <div id="choice">
        <Button title="New Canvas"/>
        <Button title="Load Canvas"/>
      </div>
    </div>
  )
}

export default home
